import React from 'react'
import './Nav.css'

const Nav = () => {
  return (
    <>
    <div className="nav">
        <img src="https://www.google.com/url?sa=i&url=http%3A%2F%2Fwww.stickpng.com%2Fimg%2Ficons-logos-emojis%2Ftech-companies%2Fnetflix-logo&psig=AOvVaw3of37id4wKlYI01u7tAjwJ&ust=1677012969937000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCJCMyKT-pP0CFQAAAAAdAAAAABAE" alt="" />
    </div>
    </>
  )
}

export default Nav;
